import "./W3.css";
import "./css/Text.css";

function GamePad(props) {
  const data = props.gamePadData;
  const classes = "w3-padding-64 " + props.className;
  return (
    <div className={classes}>
      <h1 data-shadow={data.header}>{data.header}</h1>
      <div class="w3-center-align w3-padding-large">
        <iframe
          frameborder="0"
          src="https://itch.io/embed/1202507"
          width="552"
          height="167"
        >
          <a href="https://dydrey.itch.io/trashcatcher">
            TrashCatcher by Dydrey
          </a>
        </iframe>
      </div>
      {props.children}
    </div>
  );
}
export default GamePad;
